import React, {useState, useEffect }from "react";
import { Helmet } from 'react-helmet';

import { Title, Wrapper } from './home.style'

const Home = () => {
    const [data, setData] = useState(null);
    const [cocktail, setCocktail] = useState(true);

    useEffect(async () => {
        const response = await fetch("http://localhost:5000/api/v1/data");
        const data = await response.json();
        const [item] = data.cocktails;
        setData(item);
        setCocktail(false)
    }, []);



    return (
        <div className="App">
            <Helmet>
                <style>{'body {background-color: orange; }'}</style>
            </Helmet>
            <Wrapper>
                <Title>
                    Cocktail of the Day                
                </Title>
            {cocktail && <div>{cocktail.Cocktail}</div>}
            </Wrapper>
        </div>

    ) 

}

export default Home;
